import React, { useState } from 'react';

const AddVideoForm = ({ onAddVideo }) => {
  const [title, setTitle] = useState('');
  const [url, setUrl] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    if (title && url) {
      onAddVideo({ title, url, });
      setTitle('');
      setUrl('');
    }
  };

  return (
    <div className="add-video-form">
      <button onClick={AddVideoForm}><a href = '#0' >Add a Video</a></button>
      <form onSubmit={handleSubmit}>
        <label>
          Title:
          <input type="text" value={title} onChange={(e) => setTitle(e.target.value)} />
        </label>
        <label>
          URL:
          <input type="url" value={url} onChange={(e) => setUrl(e.target.value)} />
        </label>
        <button type="submit" className='btn btn-warning'>Cancel</button>
        <button type="submit" className='btn btn-danger'>Add</button>
      </form>
       <form>
         <label>
           Search
           <input className='search-input' type="text" name="search" />
         </label>
       </form>
    </div>
  );
};

export default AddVideoForm;
